import React from "react";
import { BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer } from "recharts";

const data = [
  { experience: "0-2", salary: 40000 },
  { experience: "3-5", salary: 55000 },
  { experience: "6-9", salary: 75000 },
  { experience: "10+", salary: 95000 },
];

const SalaryCharts = () => {
  return (
    <div style={{ width: "100%", height: 400 }}>
      <h3>Average Salary by Experience</h3>
      <ResponsiveContainer>
        <BarChart data={data}>
          <XAxis dataKey="experience" />
          <YAxis />
          <Tooltip />
          <Bar dataKey="salary" fill="#8884d8" />
        </BarChart>
      </ResponsiveContainer>
    </div>
  );
};

export default SalaryCharts;
